import math

def check_prime(n):
  if n == 1: return False

  for k in range(2, int(math.sqrt(n)) + 1):
    if n % k == 0:
      return False

  return True

def main():
  N = int(input())
  if check_prime(N):
    print("YES")
  else:
    print("NO")

